parameters.jsCode:
const aiResponse = $input.first().json.output;
let enrichedData;

try {
  const jsonMatch = aiResponse.match(/\{[^}]*\}/s);
  if (jsonMatch) {
    enrichedData = JSON.parse(jsonMatch[0]);
  } else {
    throw new Error('No JSON found');
  }
} catch (e) {
  enrichedData = {
    buyer_type: 'unknown',
    estimated_budget_range: 'not_specified',
    buying_timeline: 'unknown',
    lead_quality_score: 50,
    key_insights: 'Unable to parse AI response'
  };
}

const originalData = $('Set Lead Data').first().json;

return {
  json: {
    ...originalData,
    ...enrichedData,
    enrichment_timestamp: new Date().toISOString()
  }
};

